import React from 'react';
import styled from 'styled-components';

const SecondFoldWrapper = styled.div`
  width: 100%;
  background-color: #FFFFFF;
  padding: 32px 40px;
`;

const SecondFold = () => {
  return (
    <SecondFoldWrapper>
      <div className="list">

      </div>
    </SecondFoldWrapper>
  );
};

export default SecondFold;
